description:
A film journey through a universe of female masculinity. A legendary Drag King Night in New York is the point of departure for an odyssey to transgendered worlds, where women become men - some for a night, others for their whole lives. What motivates them? What changes take place? What do they dream of? The drag kings of New York meet in clubs and change lustfully into their male alter egos, parodying them and exploring male eroticism and power strategies. In London we see women experiment with hormones to become new men and &amp;#039;cyborgs&amp;#039;. Masculinity and transformation as performance, subversion or existential necessity.

2002

Directed by Gabrielle Baur
